import Vue from 'vue';
import App from './App.vue';
import ElementUI from "element-ui";
import 'element-ui/lib/theme-chalk/index.css';
import router from "@/router/index.js";
import axios from "axios";
import './assets/global.css';
import * as echarts from 'echarts';
import { createPinia } from 'pinia'
import piniaPersist from 'pinia-plugin-persist'
import globalVariable from "../src/components/global/GlobalVariable.vue"

//引入全局变量
Vue.prototype.global = globalVariable

// 引入pinia 与其插件
const pinia = createPinia()
Vue.use(pinia)
pinia.use(piniaPersist)


Vue.prototype.$echarts = echarts;
Vue.prototype.$axios = axios;
Vue.config.productionTip = false;

Vue.use(router);
Vue.use(ElementUI);

//引入全局函数
/**
 * 1将全局变量中的user赋值
 * @param user 用于赋值的用户变量
 */
Vue.prototype.setGlobalUser = function (user) {
    globalVariable.user.userName = user.userName
    globalVariable.user.userId = user.userId
    globalVariable.user.userPassword = user.userPassword
    globalVariable.user.userIdentity = user.userIdentity
}

new Vue({
    render: h => h(App),
    router
}).$mount('#app')
